import { En_Hero } from "../comps/Portal";
import { semi } from "../constants";

const Semi = () => {
  return (
    <>
      <En_Hero
        prod={semi}
        title="Semi"
        subtitle="The Future of Trucking is Electric"
        dark
      />
      <section className="min-h-[50vh]">
        <h2></h2>
      </section>
    </>
  );
};

export default Semi;
